import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom'  
import Signup from './pages/signUp/signup';
import Login from './pages/login/login';

function App() {
  return (
    <Router>
      <div>
        <Route exact path="/">
          to="/" component={Signup}/>
        </Route>
        <Route path="/login" component={Login} />
      </div>
    </Router>
  );
};
export default App;
